import Game from './Game.js';
import Home from './Home.js';
import TShirt from './TShirt.js';
import Console from './Console.js';
function App() {
  return (
    <main className="container">
      <Game />
      <br /><br /><br />      
      <Console />
      <br /><br /><br />
      <TShirt />
    </main>
  );
}

export default App;
